CREATE DATABASE IF NOT EXISTS NHL;
USE NHL;

### CREATE STATEMENTS ###


CREATE TABLE IF NOT EXISTS Arenas #done
(
pk_arena_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
arena_name VARCHAR(50) NOT NULL,
capacity INT NOT NULL,
year_opened INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Teams #done
(
pk_team_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
team_name VARCHAR(75) NOT NULL,
wins INT NOT NULL,
losses INT NOT NULL,
overtime_losses INT NOT NULL,
points INT NOT NULL,
goals_for INT NOT NULL,
goals_against INT NOT NULL,
power_plays INT NOT NULL,
pp_goals INT NOT NULL,
power_plays_against INT NOT NULL,
ppa_goals INT NOT NULL,
sh_goals INT NOT NULL,
sh_goals_against INT NOT NULL,
shots INT NOT NULL,
shots_against INT NOT NULL,
fk_arena_id INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Coaches #done
(
pk_coach_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
coach_name VARCHAR(45) NOT NULL,
games_coached INT NOT NULL,
wins INT NOT NULL,
losses INT NOT NULL,
first_year_coaching INT NOT NULL,
latest_year_coaching INT NOT NULL,
stanley_cups_won INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Coaches_on_Teams #done
(
pk_coach_on_team_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
fk_coach_id INT NOT NULL,
fk_team_id INT NOT NULL,
games_coached INT NOT NULL,
wins INT NOT NULL,
losses INT NOT NULL,
otl INT NOT NULL
);


CREATE TABLE IF NOT EXISTS Goalies #done
(
pk_goalie_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
goalie_name VARCHAR(50) NOT NULL,
age INT NOT NULL,
games_played INT NOT NULL,
games_started INT NOT NULL,
wins INT NOT NULL,
losses INT NOT NULL,
goals_against INT NOT NULL,
shots_against INT NOT NULL,
saves INT NOT NULL,
shut_outs INT NOT NULL,
minutes INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Goalies_on_Teams #done
(
pk_goalie_on_team_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
fk_goalie_id INT NOT NULL,
fk_team_id INT NOT NULL,
games_played INT NOT NULL,
games_started INT NOT NULL,
wins INT NOT NULL,
losses INT NOT NULL,
goals_against INT NOT NULL,
shots_against INT NOT NULL,
saves INT NOT NULL,
shut_outs INT NOT NULL,
minutes INT NOT NULL
);


CREATE TABLE IF NOT EXISTS General_Managers #done
(
pk_gm_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
gm_name VARCHAR(30) NOT NULL,
tendered_since DATETIME NOT NULL,
fk_team_id INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Awards #done
(
pk_award_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
name_of_award VARCHAR(150) NOT NULL,
winner VARCHAR(50) NOT NULL,
description_of_award VARCHAR(100) NOT NULL
);

CREATE TABLE IF NOT EXISTS Players_on_Teams #done
(
pk_player_on_team_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
fk_player_id INT NOT NULL,
fk_team_id INT NOT NULL,
games_played INT NOT NULL,
goals INT NOT NULL,
assists INT NOT NULL,
points INT NOT NULL,
plus_minus INT NOT NULL,
penalties_in_minutes INT NOT NULL,
shots INT NOT NULL,
time_on_ice INT NOT NULL,
blocked_shots INT NOT NULL,
hits INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Players #done
(
pk_player_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
player_name VARCHAR(30) NOT NULL,
age INT NOT NULL,
position VARCHAR(5) NOT NULL,
games_played INT NOT NULL,
goals INT NOT NULL,
assists INT NOT NULL,
points INT NOT NULL,
plus_minus INT NOT NULL,
penalties_in_minutes INT NOT NULL,
shots INT NOT NULL,
time_on_ice INT NOT NULL,
blocked_shots INT NOT NULL,
hits INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Games #done
(
pk_game_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
game_date DATETIME NOT NULL,
fk_home_id INT NOT NULL,
home_goal_total INT NOT NULL,
fk_visitor_id INT NOT NULL,
visitor_goal_total INT NOT NULL,
type_of_win VARCHAR(10),
attendance INT NOT NULL,
length_of_game INT NOT NULL
);

CREATE TABLE IF NOT EXISTS Draft_Picks #done
(
pk_draft_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
overall INT NOT NULL,
fk_team_id INT NOT NULL,
draftee_name VARCHAR(40) NOT NULL,
nationality VARCHAR(4) NOT NULL,
pos VARCHAR(4) NOT NULL,
age INT NOT NULL,
amateur_team VARCHAR(100) NOT NULL
);

